// ReDSLLexerInit initializes any static state used to implement ReDSLLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewReDSLLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func ReDSLLexerInit() {
	staticData := &ReDSLLexerLexerStaticData
	staticData.once.Do(redsllexerLexerInit)
}

// NewReDSLLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewReDSLLexer(input antlr.CharStream) *ReDSLLexer {
	ReDSLLexerInit()
	l := new(ReDSLLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &ReDSLLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "ReDSLLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

